    private static void insertionSort(int[] arr){
        int n = arr.length;
        int curr = 1;
        int i =0;
    
        while(curr<n){
            int temp = arr[curr];
            i = curr-1;
            while(i>=0 ){
                if(arr[i]>temp){
                    arr[i+1]=arr[i];
                }else{
                    break;
                }
                i--;
            }
            arr[i+1] = temp;
            curr++;
        }
    }
    private static void bubbleSort(int[] arr){
        int n = arr.length;
        for(int i = 0 ; i < n ; i++){
            boolean swapped = false;
            for(int j = i ; j < n-1 ; j++){
                
                if(arr[i] > arr[j]){
                    swapped = true;
                    int temp = arr[i];
                    arr[i] = arr[j];
                    arr[j] = temp;
                }
            }
            if(!swapped){
                break;
            }
        }
    }
